import React from 'react';
import './App.css';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import PopisBodova from './PopisBodova'; // Import the component

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header className="App-header">
          <h1>Aplikacija za lov</h1>
          <div className="Menu">
            {/* Update the rest of your buttons similarly if they navigate to different pages */}
            <Button text="EVIDENCIJA LOVACA" />
            <Button text="RASPORED AKTIVNOSTI I LOVA" />
            <Button text="EVIDENCIJA PRISUTNOSTI NA LOVNI DAN" />
            <Button text="UNOS DIVLJAČI" />
            <Button text="UNOS ODSTRIJELENE DIVLJAČI" />
            {/* Use Link around the button you want to make clickable */}
            <Link to="/popis-bodova" style={{ textDecoration: 'none' }}>
              <Button text="BODOVI" />
            </Link>
          </div>
        </header>
        {/* Define your routes here */}
        <Routes>
          <Route path="/popis-bodova" element={<PopisBodova />} />
          {/* Add other routes as needed */}
        </Routes>
      </div>
    </BrowserRouter>
  );
}

function Button({ text }) {
  return (
    <div className="Button">
      {text}
    </div>
  );
}

export default App;
